   fetch("https://friends.roblox.com/v1/user/friend-requests/count", { credentials: "include" })
    .then(res => res.json())
    .then(data => {
        const count = data.count;

        const navFriends = document.querySelector('#nav-friends');
        if (!navFriends) return;

        navFriends.dataset.count = count;

        const notificationSpan = navFriends.querySelector('span.notification-blue');
        if (notificationSpan) {
            if (count > 0) {
                notificationSpan.classList.add('notification');
                notificationSpan.classList.remove('hide');
                notificationSpan.textContent = count;
                notificationSpan.title = count;
            } else {
                notificationSpan.classList.remove('notification');
                notificationSpan.classList.add('hide');
                notificationSpan.textContent = '';
                notificationSpan.title = '';
            }
        }
    });
